import React, { useState } from 'react';
import axios from 'axios';

const Email = () => {
    const [emailData, setEmailData] = useState({
        to: '',
        subject: '',
        body: ''
    });

    const handleInputChange = (e) => {
        setEmailData({
            ...emailData,
            [e.target.name]: e.target.value
        });
    };

    const sendEmail = () => {
        axios.post('http://localhost:your-port/api/sendEmail', emailData)
            .then(response => {
                console.log(response.data);
            })
            .catch(error => {
                console.error(error);
            });
    };

    return (
        <div>
            <label>To:</label>
            <input type="text" name="to" onChange={handleInputChange} />

            <label>Subject:</label>
            <input type="text" name="subject" onChange={handleInputChange} />

            <label>Body:</label>
            <textarea name="body" onChange={handleInputChange}></textarea>

            <button onClick={sendEmail}>Send Email</button>
        </div>
    );
};

export default Email;
